            __builder.AddMarkupContent(2, "<article>\r\n    <section id=\"willkommen\">\r\n        <h1>Herzlich Willkommen </h1>\r\n        <p>\r\n            Moderne Autos benötigen ganzheitliche System-Lösungen. Wir finden sie.<br>\r\n            Das Herz aller Systeme „Made by Montaplast“ sind dabei seit fünf Jahrzehnten hochwertige Kunststoffteile\r\n        </p>\r\n    </section>\r\n    <div class=\"parallax\"></div>\r\n   \r\n    <section id=\"philosophie\">\r\n\r\n        <p>\r\n            <h4>Unsere Unternehmensohilosophie</h4><br>\r\n            Wer vorausdenkt, gewinnt\r\n            Unser Prinzip heißt: Erst denken, dann handeln.\r\n            Von Anfang an das richtige Produkt zu entwickeln spart Kosten und Zeit.\r\n            Die Automobilindustrie ist auf der Beschleunigungsspur.\r\n            Während sich die Palette der Modelle und Varianten stark verbreitert,\r\n            werden die Produktzyklen und Entwicklungszeiten immer kürzer.\r\n            Doch die Qualität darf darunter nicht leiden.\r\n            Auf diese Herausforderung haben wir unsere eigene,\r\n            Montaplast-typische Antwort gefunden:\r\n            Bei der Bearbeitung einer Anfrage startet der Projektleiter sofort das Projektmanagement:\r\n            Aufgaben werden definiert, Verantwortlichkeiten verteilt, Termine festgelegt,\r\n            Meilensteine platziert und ein Projektteam zusammengestellt.\r\n            Das Team ist ein Querschnitt aller Montaplast-Abteilungen -\r\n            von der Entwicklung über die Kalkulation und die Fertigung bis hin zum Technischen Einkauf.\r\n            So lassen sich schnell und präzise die wichtigen Fragen klären: Welche Funktionen muss das Produkt erfüllen?\r\n            Welche Komponenten und Werkzeuge sind erforderlich? Und was wird es letztlich kosten?\r\n\r\n            \"Zeit ist Geld\" - ein alter Spruch, der nie zutreffender war als heute.\r\n            Im System Montaplast bedeutet er: Wer unnötige Schleifen vermeidet und gleich in die richtige Richtung fährt,\r\n            kommt schneller und günstiger ans Ziel.\r\n            <br>\r\n        </p>\r\n\r\n    </section>\r\n\r\n    <section>\r\n        <div id=\"geschichte\">\r\n            <h4>Aus dem Oberbergischen in die Welt</h4><br>\r\n            <h5>Geschichte und Entwicklung eines besonderen Familienunternehmens</h5>\r\n\r\n            1959 von Albert Stulz sr. in Morsbach (Oberbergischer Kreis) gegründet,<br>\r\n            steht das mittelständische Unternehmen Montaplast für inzwischen fünf<br>\r\n            Jahrzehnte Erfahrung in der Fertigung von Kunststoff-Präzisionsteilen<br>\r\n            und -Systemen - zunächst für Haushaltsgeräte, heute für die Automobilindustrie.<br>\r\n\r\n            Als 1992 in Frankfort, Kentucky, die Montaplast of North America, Inc. <br>\r\n            gegründet wurde, ging das Familienunternehmen in eine neue, expansive Phase.<br>\r\n            Inzwischen gehören Verkaufsniederlassungen und Entwicklungsbüros in Detroit,<br>\r\n            Suzhou, Nagoya, London, Paris, Stuttgart, München und Köln zu Montaplast.<br>\r\n            Im Jahr 2006 kam ein dritter Fertigungsstandort hinzu: die Montaplast Automotive System (SIP) Co.,<br>\r\n            Ltd. in Suzhou bei Shanghai.<br>\r\n        </div>\r\n    </section>\r\n    <aside>\r\n       <img src=\"https://www.montaplast.com/fileadmin/_processed_/csm_morsbach_3468_gr_4743375479.jpg\" class=\"img\" alt=\"Unser Startgebäude\"> \r\n    </aside>\r\n</article>\r\n<div class=\"parallax2\"></div>\r\n\r\n\r\n");
            __builder.AddMarkupContent(3, "<div class=\"table-responsive\">\r\n    <table class=\"table caption-top\">\r\n        <caption><h4>Geschichte</h4> </caption>\r\n        <thead>\r\n        <th scope=\"col\">Jahr</th>\r\n        <th scope=\"col\">Ereignis</th>\r\n        </thead>\r\n        <tr>\r\n            <td> 1959</td>\r\n            <td>\r\n                Firmengründung durch Herrn Albert Stulz sen.\r\n                Fertigung von Bauteilen für Haushaltsgeräte\r\n\r\n                Aufbau des Werkzeugbaus und des Extrusionsverfahrens\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>1968</td>\r\n            <td>\r\n                Vibrationsschweißen an Kunststoffteilen\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>1979</td>\r\n            <td>Einstieg in die Schmelzkerntechnik</td>\r\n        </tr>\r\n        <tr>\r\n            <td>1980</td>\r\n            <td>Inbetriebnahme der ersten Lackieranlage</td>\r\n        </tr>\r\n        <tr>\r\n            <td> 1985</td>\r\n            <td>Einführung von CAD- und CAM-Systemen</td>\r\n        </tr>\r\n        <tr>\r\n            <td>1990</td>\r\n            <td>Serienanlauf des ersten Kunststoff-Ansaugrohres in Schmelzkerntechnik für Porsche</td>\r\n        </tr>\r\n        <tr>\r\n            <td>1992</td>\r\n            <td>Eröffnung des Sales and Engineering Office in Detroit</td>\r\n        </tr>\r\n        <tr>\r\n            <td> 1993 </td>\r\n            <td>\tGründung der Montaplast of North America, Inc. in Frankfort, Kentucky </td>\r\n        </tr>\r\n        <tr> <td>1999</td>\t<td>Eröffnung des Technologiezentrums am Hauptsitz in Morsbach</td> </tr>\r\n        <tr>\r\n            <td> 2006</td>\r\n            <td>Gründung der Montaplast Automotive System (SIP) Co., Ltd. in Suzhou, China</td>\r\n        </tr>\r\n    </table>\r\n   \r\n  \r\n\r\n\r\n</div>\r\n");
